import React, { Component } from "react";
import {Alert, Card, Form, Profile} from 'tabler-react';

class AppProfile extends React.Component {
    render() {
        return (
        <div className="dashboard">
            <Card
                title="Profile"
                body={
                <div className="body">
                <Form>    
                    <Form.Input name="username" label="Username" disabled value="Jacob"/>
                    <Form.Input name="email" label="E-Mail" disabled />
                    <Form.Input name="phone" label="Phone Number" disabled />
                    <Form.Radio/>
                    <Form.Ratio/>

                </Form>
                </div>
                }
            />
            <Alert type="error" isDismissible>
                2FA Authentication is currently disabled - we are working on a solution!
            </Alert>
        </div>
        )
    }
}

export default AppProfile;
